description:
Yes this is a hunting show. But it isn't just a hunting show. It is a cooking show as well. It is many things, and that is what makes is so great. See the world, take in all these beautiful places you probably will never go. The greens, blues, tans, and white landscapes. The majestic animals. The hunt. The kill. The ritualistic carving and cleaning of the animals. The fire. The meats cooking and smoking. Me salivating. This show is great in so many ways. The most important reason is Steve's realness. He's not afraid to admit his hunting mistakes, he doesn't always get the animal he came for and that's OK because it's more about the journey to get there then the end result. Do yourself a favor and take this journey with him and become a true Meat Eater. You will be a better person for it.

